import CsvUpload from './CsvUpload'
import React, { useState } from 'react'


const Entry = () => {
    const [myData, setMyData] = useState({})

    const convertToObject = (anArray) => {

        keys = anArray.data[1],
        result = anArray.data.slice(2).map(function (a) {
            var temp = {};
            keys.forEach(function (k, i) {
                temp[k] = a[i];
            })
            return temp;
        });

    console.log(result);

    }
    return(
        <div>
        Hi
        <CsvUpload setMyData = {convertToObject}/>

        {myData.map}
        </div>
    )
}

export default Entry
